import { useState } from 'react';
import FormattedTime from './components/FormattedTime/FormattedTime'

function App() {
  const [time, setTime] = useState([
    {
      miliseconds: 0,
      interval: null
    }
  ]);
  return (
    <div>
      <FormattedTime />
    </div>
  );
}

export default App;
